@Override
public DocsAndPositionsEnum docsAndPositions(Bits liveDocs,
    DocsAndPositionsEnum reuse, int flags) throws IOException {
  if ((flags & POSITIONS) == 0 && (flags & OFFSETS) == 0) {
    return null;
